import React from 'react';
import { ReactComponent as CommunityIcon } from '../assets/icons/Vector.svg'; // Import the SVG as a React component
import avatarImage from '../assets/Mr-Journaler-front-1.png'; // Correct path to your image

const Header = () => (
  <div className="header">
    <div className="avatar">
      {/* Use img tag with width and height set to 100% to ensure the image fits the container */}
      <img
        src={avatarImage}
        alt="Chatbot Avatar"
        style={{ width: '100%', height: '100%', objectFit: 'cover' }} // Ensures image scales to fit the container
      />
    </div>
    <button
      className="community-button"
      onClick={() => window.open('https://t.me/MrJournaler', '_blank')}
    >
      <CommunityIcon className="community-button-icon" />
      <span className="community-button-text">Go to community</span>
    </button>
  </div>
);

export default Header;
